import React from 'react';

import UsersLIst from '../components/UsersList';

const Users = () => {
  const USERS = [
    {
      id: 'u1',
      name: 'Max',
      image:
        'https://www.google.com/imgres?imgurl=https%3A%2F%2Fcdn6.aptoide.com%2Fimgs%2F5%2F3%2F9%2F5398fbbd3168e2951f2237532c1eda8d_icon.png%3Fw%3D256&imgrefurl=https%3A%2F%2Fultimate-car-driving-classics.en.aptoide.com%2F&tbnid=53d-1mPaYdiaoM&vet=12ahUKEwjF39ve9eLnAhXQBFAKHaJ-BzUQMygaegQIARBn..i&docid=bmawzwsO_94reM&w=256&h=256&q=car&hl=en&ved=2ahUKEwjF39ve9eLnAhXQBFAKHaJ-BzUQMygaegQIARBn',
      place: '3',
    },
  ];

  return <UsersLIst items={USERS} />;
};

export default Users;
